b'\x00\x00\x03\x02\xd9\x03\xaf\x05\x85\x07\x5b\x09\x31\x0b\x07\x0d'\
b'\xdd\x0e\xb3\x10\x89\x12\x5f\x14'

_mvfont = memoryview(_font)

def _chr_addr(ordch):
    offset = 2 * (ordch - 48)
    return int.from_bytes(_index[offset:offset + 2], 'little')
    
def get_width(s):
    width = 0
    for ch in s:
        ordch = ord(ch)
        ordch = ordch + 1 if ordch >= 48 and ordch <= 57 else 32
        offset = _chr_addr(ordch)
        width += int.from_bytes(_font[offset:offset + 2], 'little')
    return width

def get_ch(ch):
    ordch = ord(ch)
    ordch = ordch + 1 if ordch >= 48 and ordch <= 57 else 48
    offset = _chr_addr(ordch)
    width = int.from_bytes(_font[offset:offset + 2], 'little')
    next_offs = _chr_addr(ordch +1)
    return _mvfont[offset + 2:next_offs], width
 
